import React, {useEffect, useState} from "react";
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav>
            <h2>SBC</h2>
            <ul>
                <li>
                    <Link to='/about'>About</Link>
                </li>
                <li>
                    <Link to='/services'>Services</Link>
                </li>
                <li>
                    <Link to='/contact'>Contact</Link>
                </li>
            </ul>
        </nav>
    );
}

export default Navbar;
